import EventEmitter from 'events';

const eventBus = new EventEmitter();

class EventBus {
    static install(Vue, options) {
        Vue.prototype.eventBus = eventBus;
        Vue.prototype.$broadcast = eventBus.$emit;
    }
}

export default EventBus;
export {eventBus};
